};

import React from 'react';
import TimerForm from './TimerForm';
import Timer from './Timer';

/**
 * This component is a Timer that can be opened to be edited
 */
export default class EditableTimer extends React.Component {

    state = {
        editFormOpen: false
    };


    handleEditClick = () => {
        this.openForm();
    };

    handleFormClose = () => {
        this.closeForm();
    };

    handleSubmit = (timer) => {
        this.props.onFormSubmit(timer);
        this.closeForm();
    };

    closeForm = () => {
        this.setState({ editFormOpen: false });
    };

    openForm = () => {
        this.setState({ editFormOpen: true });
    };

    /**
     * Render Method
     * @returns {XML}
     */
    render() {
        if (this.state.editFormOpen) {
            return (
                <TimerForm
                    id={this.props.id}
                    title={this.props.title}
                    project={this.props.project}
                    onFormSubmit={this.handleSubmit}
                    onFormClose={this.handleFormClose}
                />
            );
        } else {
            return ( <Timer
                    id={this.props.id}
                    title={this.props.title}
                    project={this.props.project}
                    elapsed={this.props.elapsed}
                    runningSince={this.props.runningSince}
                    onEditClick={this.handleEditClick}
                    onTrashClick={this.props.onTrashClick}
                    onStartClick={this.props.onStartClick}
                    onStopClick={this.props.onStopClick}
                />
            );
        }
    }
}

import React from 'react';
import EditableTimer from './EditableTimer';

/**
 * This component is a list of Editable Timers
 * This component is stateless
 */
export default class EditableTimerList extends React.Component {

    /**
     * Render
     * @returns {XML}
     */
    render() {
        const timers = this.props.timers.map((timer) => {
            return (
                <EditableTimer
                    key={timer.id}
                    id={timer.id}
                    title={timer.title}
                    project={timer.project}
                    elapsed={timer.elapsed}
                    runningSince={timer.runningSince}
                    onFormSubmit={this.props.onFormSubmit}
                    onTrashClick={this.props.onTrashClick}
                    onStartClick={this.props.onStartClick}
                    onStopClick={this.props.onStopClick}
                /> );
        });
        return (
            <div id='timers'>
                {timers}
            </div>
        );
    }
}

import React from 'react';
import TimerActionButton from './TimerActionButton';
import helpers from '../helpers';

/**
 * This component shows a simple timer, the timer update the time showed every 50ms
 */
export default class Timer extends React.Component {

    state = {
        buttons : false
    };

    /**
     * When the component is mounted, force the refresh every 50ms
     */
    componentDidMount() {
        /**
         * This variable is used to stop the forceUpdate when the component is unmounted
         * @type {number}
         */
        this.forceUpdateInterval = setInterval( () => this.forceUpdate(), 50 );
    }

    /**
     * When the component is about to be unmounted, stop the refresh
     */
    componentWillUnmount() {
        clearInterval( this.forceUpdateInterval );
    }

    handleTrashClick = () => {
        this.props.onTrashClick(this.props.id);
    };

    handleStartClick = () => {
        this.props.onStartClick(this.props.id);
    };

    handleStopClick = () => {
        this.props.onStopClick(this.props.id);
    };

    showButtons = () => {
        this.setState({
            buttons : true
        });
    }

    hideButtons = () => {
        this.setState({
            buttons : false
        });
    }

    /**
     * Render
     * @returns {XML}
     */
    render() {
        const elapsedString = helpers.renderElapsedString( this.props.elapsed, this.props.runningSince );
        let buttons;
        if ( this.state.buttons ) {
            buttons = (
                <TimerActionButton
                    timerIsRunning={!!this.props.runningSince}
                    onStartClick={this.handleStartClick}
                    onStopClick={this.handleStopClick}
                />
            );
        }
        return (
            <div className='ui centered card' onMouseEnter={this.showButtons} onMouseLeave={this.hideButtons}>
                <div className='content'>
                    <div className='header'> {this.props.title}
                    </div>
                    <div className='meta'>
                        {this.props.project} </div>
                    <div className='center aligned description'>
                        <h2>
                            {elapsedString}
                        </h2></div>
                    <div className='extra content'>
                        <span
                            className='right floated edit icon'
                            onClick={this.props.onEditClick}
                        >
                            <i className='edit icon'></i>
                        </span>
                        <span
                            className='right floated trash icon'
                            onClick={this.handleTrashClick}
                        >
                            <i className='trash icon'></i>
                        </span>
                    </div>
                </div>
                {buttons}
            </div>
        );
    }
}

import React from 'react';

/**
 * This component is a simple button, if the timer is running is a Stop button, else is a Start button
 */
export default class TimerActionButton extends  React.Component {

    /**
     * Render
     * @returns {XML}
     */
    render() {
        if (this.props.timerIsRunning) {
            return (
                <div
                    className='ui bottom attached red basic button'
                    onClick={this.props.onStopClick}
                >
                    Stop
                </div>
            );
        } else {
            return (
                <div
                    className='ui bottom attached green basic button'
                    onClick={this.props.onStartClick}
                >
                    Start
                </div>
            );
        }
    }

}

import React from 'react';

/**
 * This component is a Timer when is being edited
 */
export default class TimerForm extends React.Component {

    state = {
        titleError: false,
        projectError: false
    };

    handleSubmit = () => {
        const titleError = !this.refs.title.value.trim().length;
        const projectError = !this.refs.project.value.trim().length;
        this.setState({
            titleError,
            projectError
        });
        if (!titleError && !projectError) {
            this.props.onFormSubmit({
                id: this.props.id,
                title: this.refs.title.value,
                project: this.refs.project.value
            });
        }
    };

    /**
     * Render
     * @returns {XML}
     */
    render() {
        const submitText = this.props.id ? 'Update' : 'Create';
        const titleClass = this.state.titleError ? 'field error' : 'field';
        const projectClass = this.state.projectError ? 'field error' : 'field';
        return (
            <div className='ui centered card'>
                <div className='content'>
                    <div className='ui form'>
                        <div className={titleClass}>
                            <label>Title</label>
                            <input type='text' ref="title" defaultValue={this.props.title}/></div>
                        <div className={projectClass}>
                            <label>Project</label>
                            <input type='text' ref="project" defaultValue={this.props.project}/></div>
                        <div className='ui two bottom attached buttons'>
                            <button
                                className='ui basic blue button'
                                onClick={this.handleSubmit}
                            >
                                {submitText}
                            </button>
                            <button
                                className='ui basic red button'
                                onClick={this.props.onFormClose}
                            >
                                Cancel
                            </button>
                        </div>
                    </div>
                </div>
            </div> );
    }
}

import React from 'react';
import helpers from '../helpers';
import ServerCommunication from '../helpers/serverCommunication';

import EditableTimerList from './EditableTimerList';
import ToggleableTimerForm from './ToggleableTimerForm';

const Client = new ServerCommunication();

/**
 * This is the main component, it shows a list of editable timers and a button/box to create a new timer
 * It also handle all the logic and communication with the server
 */
export default class TimersDashboard extends React.Component {

    state = {
        timers: []
    };

    handleEditFormSubmit = (attrs) => {
        this.updateTimer(attrs);
    };

    handleStartClick = (timerId) => {
        this.startTimer(timerId);
    };

    handleStopClick = (timerId) => {
        this.stopTimer(timerId);
    };

    /**
     * Return a function for filter/find in an array an element with the specified id
     * @param {string} searched_id
     * @returns {function(arg : {id: string}): boolean}
     */
    static byId(searched_id) {
        return ({id}) => id === searched_id;
    }

    /**
     * Update a timer using the defined id
     * @param {string} id
     * @param {APITimer} attrs
     */
    updateTimerById(id, attrs) {
        const timers = this.state.timers.slice();
        const timerPos = timers.findIndex(TimersDashboard.byId(id));
        if (~timerPos) {
            timers[timerPos] = Object.assign({}, timers[timerPos], attrs);
            this.setState({
                timers
            });
        }
    }

    /**
     * Update a timer
     * @param {APITimer} attrs
     */
    updateTimer(attrs) {
        this.updateTimerById(attrs.id, {
            title: attrs.title,
            project: attrs.project
        });
        Client.updateTimer(attrs);
    }

    /**
     * Start a timer
     * @param {string} timerId
     */
    startTimer(timerId) {
        this.updateTimerById(timerId, {
            runningSince: Date.now()
        });
        Client.startTimer({
            id: timerId
        });
    }

    /**
     * Stop a timer
     * @param {string} timerId
     */
    stopTimer(timerId) {
        const timer = this.state.timers.find(TimersDashboard.byId(timerId));
        if (timer) {
            this.updateTimerById(timerId, {
                elapsed: timer.elapsed + Date.now() - timer.runningSince,
                runningSince: null
            });
            Client.stopTimer({
                id: timerId
            });
        }
    }

    handleCreateFormSubmit = (timer) => {
        this.createTimer(timer);
    };

    /**
     * Create a new timer
     * @param {APITimer} timer
     */
    createTimer(timer) {
        const t = helpers.newTimer(timer);
        this.setState({
            timers: this.state.timers.concat(t)
        });
        Client.createTimer(timer)
    }

    handleTrashClick = (timerId) => {
        this.deleteTimer(timerId);
    };

    /**
     * Delete the specified timerId from the server
     * @param {string} timerId
     */
    deleteTimer(timerId) {
        this.setState({
            timers: this.state.timers.filter(({id}) => id !== timerId)
        });
        Client.deleteTimer( timerId );
    }

    loadTimersFromServer = async() => {
        try {
            const timers = await Client.getTimers();
            this.setState({
                timers
            });
        } catch (err) {
            console.error(err);
        }
    }

    /**
     * Reload the data from the server every 5s
     */
    componentDidMount() {
        this.loadTimersFromServer();
        /**
         * Ref of the setInterval
         * This variable is used to clear the interval when the element is unmounted
         * @type {number}
         */
        this.ajaxInterval = setInterval(this.loadTimersFromServer, 5000);
    }

    /**
     * Stop loading the data from the server
     */
    componentWillUnmount() {
        clearInterval(this.ajaxInterval);
    }

    /**
     * Render
     * @returns {XML}
     */
    render() {
        return (
            <div className='ui three column centered grid'>
                <div className='column'>
                    <EditableTimerList
                        onFormSubmit={this.handleEditFormSubmit}
                        onTrashClick={this.handleTrashClick}
                        onStartClick={this.handleStartClick}
                        onStopClick={this.handleStopClick}
                        timers={this.state.timers}
                    />
                    <ToggleableTimerForm
                        onFormSubmit={this.handleCreateFormSubmit}
                        isOpen={true}/>
                </div>
            </div>
        );
    }
}

import React from 'react';
import TimerForm from './TimerForm';

/**
 * This component shows a timer or a form to edit the timer, based on his internal state
 */
export default class ToggleableTimerForm extends React.Component {

    state = {
        isOpen: false
    };

    handleFormOpen = () => {
        this.setState({
            isOpen: true
        });
    };

    handleFormClose = () => {
        this.setState({ isOpen: false });
    };

    handleFormSubmit = (timer) => {
        this.props.onFormSubmit(timer);
        this.setState({ isOpen: false });
    };

    /**
     * Render
     * @returns {XML}
     */
    render() {
        if (this.state.isOpen) {
            return (
                <TimerForm
                    onFormSubmit={this.handleFormSubmit}
                    onFormClose={this.handleFormClose}
                />
            );
        } else {
            return (
                <div className='ui basic content center aligned segment'>
                    <button
                        className='ui basic button icon'
                        onClick={this.handleFormOpen}
                    >
                        <i className='plus icon'></i>
                    </button>
                </div> );
        }
    }
}

import request from 'superagent';

/**
 * This class handle all the communication with the server
 * Providing a set of methods that returns Promises
 */
export default class ServerCommunication {

    /**
     * @param {string} [baseUrl=''] - Location of the api
     */
    constructor(baseUrl = '') {
        /**
         * Location of the api
         * @type {string}
         */
        this.baseUrl = baseUrl;
    }

    /**
     * @typedef {Object} APITimer
     * @property {string} title - Title of the Timer
     * @property {string} project - Name of the Project
     * @property {number} elapsed - Elapsed milliseconds
     * @property {string} id - UUIDv4 of the timer
     * @property {number|null} runningSince - Unix Timestamp of when the timer was started
     */

    /**
     *
     * @returns {Promise<Array<APITimer>>}
     */
    async getTimers() {
        return (await request.get(`${this.baseUrl}/api/timers`)).body;
    }

    /**
     * Start a timer
     * @param {Object} arg
     * @param {string} arg.id
     * @param {number} arg.start
     * @returns {Promise}
     */
    async startTimer({id, start = Date.now() }) {
        return await request.post(`${this.baseUrl}/api/timers/start`, {id, start});
    }

    /**
     * Stop a timer
     * @param {Object} arg
     * @param {string} arg.id
     * @param {number} arg.stop
     * @returns {Promise}
     */
    async stopTimer({id, stop = Date.now() }) {
        return await request.post(`${this.baseUrl}/api/timers/stop`, {id, stop});
    }

    /**
     * Create a new timer
     * @param {APITimer} attrs
     * @returns {Promise}
     */
    async createTimer( attrs ) {
        return await request.post(`${this.baseUrl}/api/timers` , attrs );
    }

    /**
     * Change a property of a timer
     * @param {APITimer} attrs
     * @returns {Promise}
     */
    async updateTimer( attrs ) {
        return await request.put(`${this.baseUrl}/api/timers` , attrs );
    }

    /**
     * Delete a timer
     * @param {string} id
     * @returns {Promise}
     */
    async deleteTimer( id ) {
        return await request.delete(`${this.baseUrl}/api/timers` , { data : id } );
    }

}

import uuid from 'uuid';

function newTimer(attrs = {}) {
    return {
        title: attrs.title || 'Timer',
        project: attrs.project || 'Project',
        id: uuid.v4(), // eslint-disable-line no-undef
        elapsed: 0
    };
}

function findById(array, id, cb) {
    cb(array.find(el => el.id === id));
}

function renderElapsedString(elapsed, runningSince) {
    let totalElapsed = elapsed;
    if (runningSince) {
        totalElapsed += Date.now() - runningSince;
    }
    return millisecondsToHuman(totalElapsed);
}

function millisecondsToHuman(ms) {
    const seconds = Math.floor((ms / 1000) % 60);
    const minutes = Math.floor((ms / 1000 / 60) % 60);
    const hours = Math.floor(ms / 1000 / 60 / 60);

    return [
        pad(hours.toString(), 2),
        pad(minutes.toString(), 2),
        pad(seconds.toString(), 2)
    ].join(':');

}

function pad(numberString, size) {
    let padded = numberString;
    while (padded.length < size) padded = '0' + padded;
    return padded;
}

export default {
    millisecondsToHuman: millisecondsToHuman,
    newTimer: newTimer,
    findById: findById,
    renderElapsedString: renderElapsedString
};
